import './css/App.css';
import React from 'react';
import CardContainer from './CardContainer'
import ProductDetails from './ProductDetails';
import { Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <h1>Items for Sale!</h1>
      <CardContainer/>
        <Route path="/details">
          <ProductDetails />
        </Route>
    </div>
  );
}

export default App;
